import React, { useState, useEffect } from 'react';
import { Box, Button } from 'react-bulma-components';

function Feed({ albums }) {
  return (
    <Box>
        [albums.map((album, i) => (
            <div key={album.tralbum_id} id={album.tralbum_id}>
                <p>{album.title}</p>
            </div>

        ))]
    </Box>
  )
}

export default Feed
